	  crankingFuel    = scalar,  F32,     44,              "ms",            1,       0.0;
      baseFuel        = scalar,  F32,     48,              "ms",           1,         0
      tCharge         = scalar,  F32,     52,              "T",             1,       0.0;
      ign_adv         = scalar,  F32,     56,              "deg",           1,       0.0;
      sparkDwell      = scalar,  F32,     60,              "MAP",           1,       0.0;
